    "    #选择路径\\n\",\n",
    "    def ChoiceImage(self):\n",
    "        global path\n",
    "        path = QFileDialog.getOpenFileName(self,\"选取文件\", self.cwd, \"Image files (*.jpg *.raw *.png)\")\n",
    "        print(path)   \n",
    "        \n",
    "    def push_1(self):\n",
    "        #第一步：去除背景（选择波段:103）\n",
    "        global fname\n",
    "        global fname2\n",
    "        global img\n",
    "        input1 = self.horizontalSlider.value()\n",
    "        path1 = path\n",
    "        path2 = path1[0]\n",
    "        fname,fename = os.path.split(path2)\n",
    "        fname2,fename2 = os.path.splitext(path2)\n",
    "        img = envi.open('E:/header.hdr',fname2+'.raw')\n",
    "        \n",
    "        if os.path.isdir(fname2):  \n",
    "            shutil.rmtree(fname2, True)  \n",
    "        os.mkdir(fname2)\n",
    "        \n",
    "        if os.path.isdir(fname2+'/Small'):  #判断文件夹dir是否存在\\n\",\n",
    "            shutil.rmtree(fname2+'/Small', True)  #删除文件夹dir\\n\",\n",
    "        os.mkdir(fname2+'/Small')   #建立文件夹dir\\n\",\n",
