    "  \n",
    " \n",
    "\n",
    "        src = img[:,:,input1] * 255\n",
    "        \n",
    "        src2 = img[:,:,input1] \n",
    "        \n",
    "        for i in range(0,991):\n",
    "            for j in range(0,960):\n",
    "                if src[i,j]>180:\n",
    "                    src[i,j] = 0\n",
    "\n",
    "        cv2.imwrite(fname2+'/Big/1_tezheng.jpg', src)\n",
    "        size = (491, 481) \n",
    "        qwe2 = cv2.resize(src, size, interpolation=cv2.INTER_AREA)\n",
    "        cv2.imwrite(fname2+'/Small/1_tezheng.jpg', qwe2) \n",
    "\n",
    "        self.label.setPixmap(QPixmap(fname2+'/Small/1_tezheng.jpg'))\n",
